import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './login/login.component';
import { RegisterComponent } from './register/register.component';
import { HomeComponent } from './home/home.component';

const routes: Routes = [
  { path: './login/login', component: LoginComponent },
  { path: './register/register', component: RegisterComponent },
  { path: './home/home', component: HomeComponent },
  // Agrega más rutas según sea necesario
  { path: '', redirectTo: '/home', pathMatch: 'full' }, // Ruta por defecto redirige a /login
  { path: '**', redirectTo: '/login' }, // Ruta para manejar rutas no encontradas, también redirige a /login
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
